(14, 'terms_condition', '<h2>Terms and conditions of The Allchemy</h2>\r\n\r\n<p>By using The Allchemy website and ordering products from us, you agree to the following terms and conditions.<br />\r\n-All products are handmade and therefore unique. Slight variations in color, shape, and size may occur from piece to piece.<br />\r\n-We do our best to ensure that all products arefree of defects, but we cannot guarantee that every product will be perfect. If you find a defect with your purchase, please contact us so we can try to resolve the issue.<br />\r\n-Due to the nature of handmade items, we do not accept returns or exchanges unless an item is damaged or defective. We ask that you please choose carefully before making a purchase.<br />\r\n-Payment is required in full at the time of ordering. We accept PayPal and all major credit cards. Your order will not be processed until payment has been received.<br />\r\nFor more information send us email on&nbsp;theallchemy@gmail.com</p>', NULL, '2023-02-06 10:10:23'),
(15, 'about_us', '<p>TheAllchemy&#39;s mission is to deliver everyday items that are often overlooked but add great value to our lives. It caters to the shopping needs to discerning customers, who want these quality products at affordable prices. You will be delighted to browse through our curated collections of products made just for you. Our products are made of various fine materials from wood to glass to metal, and so on. We hope to make a difference to your well being by organizing miniature articles that are sourced from across the Indian geography. Happy Shopping !</p>', NULL, '2023-02-06 10:08:40'),
