he privacy statements of each and every web site that collects personally identifiable information. This privacy statement applies solely to information collected by this Site.<br />\r\n<br />\r\n<strong>6. Children&#39;s Online Privacy Protection Act Compliance</strong><br />\r\nProtecting the safety and privacy of the children who visit our Website is always a top priority for us. In compliance with the requirements of COPPA (Children&#39;s Online Privacy Protection Act), we do not knowingly collect personally identifiable information from anyone under 13 years old. Our family friendly website does not target younger audiences. If a parent believes that his or her child has provided us with personally identifiable information, he or she should contact us immediately.<br />\r\n<br />\r\n<strong>7. Changes</strong><br />\r\nFrom time to time, we may make changes to this privacy policy. If we decide to change our privacy policy, we will post those changes on this page. We recommend that you check this page periodically to ensure that you are familiar with the current version.</p>\r\n\r\n<p>&nbsp;</p>', NULL, '2023-02-06 10:09:41'),
