(87, 'refund-policy', '<p>At our home decor and clothing eCommerce website, we strive to provide the best products and services to our customers. However, we understand that there may be situations where a refund is necessary. We have established the following refund policy to ensure fair and transparent practices for all our customers.</p>\r\n\r\n<p>Eligibility for Refunds:</p>\r\n\r\n<ol>\r\n	<li>Refunds may be requested for items that are defective, damaged, or not as described on our website.</li>\r\n	<li>Refunds may also be requested for orders that are canceled within the specified cancellation timeframe, as mentioned in our cancellation policy.</li>\r\n	<li>Refunds are subject to approval by our customer service team after reviewing the request and the specific circumstances of the order.</li>\r\n</ol>\r\n\r\n<p>Refund Process:</p>\r\n\r\n<ol>\r\n	<li>To request a refund, please contact our customer service team via email or phone as provided on our website. Please provide your order number, details of the issue, and any supporting documentation such as photos or videos.</li>\r\n	<li>Our customer service team will review your request and may require additional information or evidence to verify the issue.</li>\r\n	<li>If the refund request is approved, we will issue a refund to your original payment method within 5 business days from the approval date. Please note that the refund amount may be subject to deductions for shipping fees, restocking fees, or other applicable charges as mentioned below.</li>\r\n</ol>\r\n\r\n<p>Refund Deductions:</p>\r\n\r\n<ol>\r\n	<li>Shipping fees: If the item(s) were shipped to you, the original shipping fees incurred for the order may be deducted from the refund amount.</li>\r\n	<li>Restocking fees: In some cases, a restocking fee may be applied for returned items, particularly for large or bulky items that require additional handling or processing.</li>\r\n	<li>Other applicable charges: Depending on the specific circumstances, there may be other charges such as customs duties, taxes, or fees that may be deducted from the refund amount.</li>\r\n</ol>\r\n\r\n<p>Exceptions:</p>\r\n\r\n<ol>\r\n	<li>Final Sale or Non-Refundable items: Some items or promotions may be marked as &quot;Final Sale&quot; or &quot;Non-Refundable,&quot; and refunds will not be issued for such items.</li>\r\n	<li>Custom or personalized items: Refunds may not be possible for custom or personalized items, as they are made-to-order or specifically tailored to your preferences.</li>\r\n	<li>Return shipping: Return shipping costs for eligible refunds may be the responsibility of the customer, unless the return is due to our error or a defective/damaged item.</li>\r\n</ol>\r\n\r\n<p>Please note that our refund policy may be subject to change without prior notice. It is your responsibility to review our refund policy before making a purchase on our website.</p>\r\n\r\n<p>We appreciate your cooperation in adhering to our refund policy. If you have any questions or concerns, please contact our customer service team, and we will be happy to assist you. Thank you for shopping with us!</p>\r\n\r\n<p>&nbsp;</p>', NULL, '2023-04-13 05:44:04'),
(88, 'return-policy', '<p>1. We want you to love our products! If you&#39;re not satisfied with your purchase, simply return the product(s) within 7 days of receipt. All returns must be unworn, unused, and in original condition (including tags).<br />\r\n<br />\r\n2. Please note that we cannot accept returns on items purchased at events.<br />\r\n<br />\r\n3. Items returned after 7 days may incur a restocking fee.<br />\r\n<br />\r\n4. Shipping fees are non-refundable.<br />\r\n<br />\r\n5. If you have any questions about our Return Policy, please contact us at theallchemy@gmail.com.</p>', NULL, '2023-02-06 10:09:06'),
(89, 'cancellation-policy', '<p>Order Cancellation Timeframe:</p>\r\n\r\n<ol>\r\n	<li>If you wish to cancel your order, you must do so within 24 hours of placing the order. After 24 hours, we may have already processed and shipped your order, and cancellation may not be possible.</li>\r\n	<li>For custom or made-to-order items, cancellation requests must be made within 48 hours of placing the order. After 48 hours, the production process may have already started, and cancellation may not be possible.</li>\r\n</ol>\r\n\r\n<p>Cancellation Process:</p>\r\n\r\n<ol>\r\n	<li>To request a cancellation, please contact our customer service team via email or phone as provided on our website. Please provide your order number and reason for cancellation.</li>\r\n	<li>Our customer service team will review your request and confirm if cancellation is possible. If the order has not been processed or shipped, we will cancel your order and issue a refund to your original payment method within 5 business days.</li>\r\n	<li>If the order has already been processed or shipped, cancellation may not be possible. In such cases, you may need to return the item(s) in accordance with our Return Policy.</li>\r\n</ol>\r\n\r\n<p>Exceptions:</p>\r\n\r\n<ol>\r\n	<li>In some cases, we may have a &quot;Final Sale&quot; or &quot;Non-Cancellable&quot; policy on certain items or promotions. These items are not eligible for cancellation and refunds.</li>\r\n	<li>For personalized or customized items, cancellation may not be possible once production has started.</li>\r\n	<li>If your order has been shipped and is in transit, cancellation may not be possible. In such cases, you may need to follow our Return Policy upon receiving the item(s).</li>\r\n</ol>\r\n\r\n<p>Please note that our cancellation policy may be subject to change without prior notice. It is your responsibility to review our cancellation policy before placing an order on our website.</p>\r\n\r\n<p>We appreciate your understanding and cooperation in adhering to our cancellation policy. If you have any questions or concerns, please contact our customer service team, and we will be happy to assist you. Thank you for shopping with us!</p>\r\n\r\n<p>&nbsp;</p>', NULL, '2023-04-13 05:40:39'),
