(1, 'admin', 1, 'Test product', 'test-product-0l791o', 'physical', '[{\"id\":\"1\",\"position\":1}]', 1, 'pc', 1, 1, NULL, NULL, '[\"2023-02-06-63e0b0f965b90.png\",\"2023-02-06-63e0b0f966631.png\",\"2023-02-06-63e0b0f966f0c.png\",\"2023-02-06-63e0b0f9677c2.png\"]', '2023-02-06-63e0b0f967ef2.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 200, 180, '', 'percent', '0', 'flat', 0, 1, '<p>A good quality electric men&rsquo;s shaver makes the shaving experience a pleasant one. Whether it&rsquo;s trimming facial hair, getting rid of the nose hair, or getting an immaculate clean shave, an electric shaver helps you to do all tasks seamlessly. What&rsquo;s more? The electric shavers are ideal for those with sensitive skin, and you don&rsquo;t have to bother about painful razor cuts. Regardless of your tight schedule, an electric shaver and trimmer is the one-stop solution for all your shaving needs. There are different types of electric shavers, such as electric foil shavers, rotatory electric shavers, corded, and cordless shavers. The price of the men&rsquo;s shavers online can vary depending upon the product variant, brand, and additional features. Brands like Syska, Panasonic, PHILIPS, HAVELLS, Richards n Steven, etc., manufacture top-notch quality electric shavers. Panasonic ES-LV9Q is an excellent choice for both men and women with sensitive skin. Electric men&rsquo;s shavers come with a set of instructions and the precautions you need to take while shaving. Depending on your shaving requirements, choose from the variety of shavers available online after checking reviews and ratings, and get them delivered to your doorstep easily.</p>', 0, NULL, '2023-02-06 07:49:13', '2023-02-06 09:09:12', 0, 0, NULL, NULL, 'def.png', 1, NULL, 0.00, 0, NULL, NULL, '115776'),
(2, 'admin', 1, 'Dhokra Decorative Nandi Big', 'dokra-decorative-nandi-big-T8Kv0w', 'physical', '[{\"id\":\"1\",\"position\":1}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-06-63e0c255ca900.png\",\"2023-02-06-63e0c255cb4c2.png\",\"2023-02-06-63e0c255cbbed.png\",\"2023-02-06-63e0c255cbfcb.png\",\"2023-02-06-63e0c255cc3f6.png\"]', '2023-02-06-63e0bf802ca61.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1299, 719, '', 'percent', '20', 'percent', 1, 1, '<p>Dokra Decorative Nandi&nbsp;<br />\r\nMaterial: Brass, Art Type: Dhokra Art which is 100% handmade using the lost-wax casting technique.<br />\r\nThe allchemy brings you this decorative tribal Nandi figurine made of good-quality brass. Brass-sitting Nandi has very fine finishing handcrafted by the skilled artisans of the Bastar region. Tribal Nandi enhances the decor value of your house, office or temple and will add a spot of lustre to the ambience. Indeed these collectables add elegance to home decor. Crafted by the tribal artisans of Chhattisgarh (Dhokra art of Chhattisgarh). Dhokra craft is a casting technique using age-old wax casting. Hence, the product might have some black/dull patches which is a symbol of handcrafted Dhokra art.&nbsp;<br />\r\nPerfect to decorate your home. Can also be used as a showpiece for office tables and as a gift option for housewarming &amp; other occasions<br />\r\nCarefully Handcrafted by the Tribal Artisans of India.</p>', 0, NULL, '2023-02-06 08:51:12', '2023-04-25 10:59:10', 1, 0, 'The Allchemy Dhokra Decorative Nandi | Handcrafted Decorative Dhokra Nandifor Home Decor', 'Handcrafted Decorative Dhokra Nandifor Home Decor. Buy Brass Nandi Handcrafted Dhokra Art for Home Decoration online at low price.', '2023-02-15-63ecc36737c21.png', 1, NULL, 0.00, 0, NULL, NULL, '110895'),
(3, 'admin', 1, 'Dhokra Decorative Ganesha', 'dokra-decorative-ganesha-ZOPYBn', 'physical', '[{\"id\":\"1\",\"position\":1}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-07-07-64a7b3de4d73e.png\"]', '2023-07-07-64a7b3de4def7.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1299, 627, '', 'percent', '10', 'percent', 1, 1, '<p>Metal Ganesha<br />\r\nDHOKRA/BELL METAL is an alloy of brass, nickel and zinc that gives an antique effects of the castings.<br />\r\nOur entire collection is designed by experienced designers, having a good sense of arts, style and trends as well as its specific requirements. Our collection is acknowledged for its creativity, design and exclusive products that are beyond comparison. An ecstatic collection of products that are designed in vibrant and distinct styles to suit the requirements of prospective customers.<br />\r\nPerfect to decorate your home. Can also be used as a showpiece for office tables and as a gift option for housewarming &amp; other occasions<br />\r\nCarefully Handcrafted by the Tribal Artisans of India.<br />\r\nAll Our products are traditional craft which are 100% Eco-friendly. It is well known fact that all tribal craft are based by concept and by process, which does no harm to its heritage and environment. In fact by rituals and by folklore of this craft they communicate with there upcoming generation to keep them as necessary tradition. All these have survived for centuries. This is main reason that world wide all tribal artwork is more pronounce than handicrafts of other region..</p>', 0, NULL, '2023-02-06 09:05:58', '2023-07-07 06:47:56', 1, 0, 'The Allchemy Dhokra Decorative Ganesha | Dhokra Art Lord Ganesha Decorative Showpiece', 'Dhokra Art Lord Ganesha Decorative: Metal Ganesha: This is an excellent dhokra art handicraft product of Lord Ganesha, It is Made of an alloy of brass, nickel & zinc that gives an antique eff', '2023-07-07-64a7b3fb28c0a.png', 1, NULL, 0.00, 0, NULL, NULL, '131713'),
(4, 'admin', 1, 'Dhokra Decorative Deer', 'dokra-decorative-deer-7OBBbT', 'physical', '[{\"id\":\"1\",\"position\":1}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-07-07-64a7b13822bc5.png\",\"2023-07-07-64a7b1382311c.png\"]', '2023-07-07-64a7b13823906.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1299, 635, '', 'percent', '15', 'percent', 1, 1, '<p>Metal deer showpiece&nbsp;<br />\r\nMaterial: Brass, Art Type: Dhokra Art which is 100% handmade using the lost-wax casting technique.<br />\r\nDokra craft, the ancient, lost-wax method of metal casting, goes back as far as the Mohenjodaro period, and has a rich legacy in the history of Bengal&rsquo;s handicrafts. Dokra artefacts are admired all over the world for its primeval simplicity and enchanting folk motifs. The traditional ironsmiths of Bengal, known as Kamars or Karmakars, in the districts of Bankura, Medinipur, Purulia, Birbhum and Bardhaman excel in this exquisite art of metal casting. Bengal&rsquo;s Dokra with provenance in Bankura and Bardhaman has been conferred on with Geographical Indication (GI) for its unique beauty. Today, Dokra artefacts range from figurines, deities, elephant, owl, deer and other animals to ornaments like anklet, ankle bells, earring, necklace, bangle etc. They also make utility items like nut cracker, kohl holder, vermillion holder, utensils etc.<br />\r\nPerfect to decorate your home. Can also be used as a showpiece for office tables and as a gift option for housewarming &amp; other occasions<br />\r\nCarefully Handcrafted by the Tribal Artisans of India.</p>', 0, NULL, '2023-02-06 09:09:55', '2023-07-07 06:31:24', 1, 0, 'The Allchemy Dhokra Decorative Deer | Handmade Brass Dhokra Art Deer Decorative Showpiece', 'Handmade Brass Dhokra Art Deer Decorative Showpiece: The deer statues will be a perfect addition to your living or workplace spaces and will be a nice decor piece.', '2023-02-15-63ecc4207eea8.png', 1, NULL, 0.00, 0, NULL, NULL, '123483'),
(5, 'admin', 1, 'Handmade Dhokra Decorative Sheshnaag with Shivling', 'dokra-decorative-sheshnaag-3brvwP', 'physical', '[{\"id\":\"1\",\"position\":1}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-06-63e0c5a3e25db.png\",\"2023-02-06-63e0c5a3e329c.png\",\"2023-02-06-63e0c5a3e3be5.png\",\"2023-02-06-63e0c5a3e4075.png\",\"2023-02-06-63e0c5a3e4524.png\"]', '2023-02-06-63e0c5a3e49d0.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1299, 626, '', 'percent', '15', 'percent', 1, 1, '<p>Handmade Dhokra Decorative Shiva Shivling With Sheshnaag is the status of eternity, the symbolic icon of Lord Shiva. The shivling represents the primeval power of the creator. At the end of all formation, during the great inundation, all the different aspects of God are believed to get a resting place in the shivling.</p>', 0, NULL, '2023-02-06 09:17:23', '2023-05-13 05:56:18', 1, 0, 'The Allchemy Handmade Dhokra Decorative Sheshnaag with Shivling | Handcrafted Decorative Dhokra Sheshnaag', 'Handmade Dhokra Decorative Shiva Shivling With Sheshnaag is the status of eternity, the symbolic icon of Lord Shiva.', '2023-02-15-63ecc476195aa.png', 1, NULL, 0.00, 0, NULL, NULL, '153817'),
