(100, 'admin', 2, 'Dhokra Decorative Elephant', 'dokra-decorative-elephant-EaQryG', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"34\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-07-07-64a7bd2c6d0a2.png\",\"2023-07-07-64a7bd2c6d741.png\"]', '2023-07-07-64a7bd2c6de75.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1299, 315, '', 'percent', '10', 'percent', 1, 1, '<p>&nbsp;</p>\r\n\r\n<p>Dokra is non&ndash;ferrous metal casting using the lost-wax casting technique. This sort of metal casting has been used in India for over 4,000 years and is still used. One of the earliest known lost wax artefacts is the dancing girl of Mohenjo-daro. Dokra horses, elephants, peacocks, owls, religious images, measuring bowls, and lamp caskets etc., are highly appreciated. Dokra Damar tribes are the traditional metalsmiths of West Bengal. Their technique of lost wax casting is named after their tribe, hence Dokra metal casting. The tribe extends from Jharkhand to West Bengal and Orissa; members are distant cousins of the Chhattisgarh Dhokras. A few hundred years ago the Dhokras of Central and Eastern India traveled south as far as Kerla and north as far as Rajasthan and hence are now found all over India.</p>', 0, NULL, '2023-02-10 07:21:52', '2023-07-07 07:22:57', 1, 1, 'The Allchemy Dhokra Decorative Elephant', 'Dhokra  is nonferrous metal casting using the lost-wax casting technique. This sort of metal casting has been used in India for over 4,000 years and is still used. One of the earliest known', '2023-02-17-63ef1ee325ad8.png', 1, NULL, 0.00, 0, NULL, NULL, '166853'),
