(107, 'admin', 2, 'Dhokra Turtle', 'dokra-turtle-rVlwKF', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"34\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-10-63e61996601c1.png\",\"2023-02-10-63e6199664993.png\",\"2023-02-10-63e6199664f2f.png\",\"2023-02-10-63e6199665464.png\",\"2023-02-10-63e6199665872.png\"]', '2023-02-10-63e6199665c40.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 999, 181, '', 'percent', '30', 'percent', 5, 1, '<h1>About this product</h1>\r\n\r\n<ul>\r\n	<li>THE ALLCHEMY dhokra item has beautiful curve features in its design. It is a must have if you want to add that Royal touch to your home.</li>\r\n	<li>Dimension: Height - 12&quot; ; Width - 4.5&quot; ; Length - 8&quot;</li>\r\n	<li>Weight: 250 g (Approx.)</li>\r\n	<li>Care: Wipe gently with a soft cloth when needed.</li>\r\n	<li>Handcrafted Dhokra Brass Metal items are ideal for home decor, desk decor or a perfect gift item for birthday, marriage, engagement and any other occasions.</li>\r\n	<li>\r\n	<p>Dhokra is non&ndash;ferrous metal casting using the lost-wax casting technique. This sort of metal casting has been used in India for over 4,000 years and this art form is still practiced in various parts of villages in Odisha ,Chhattisgarh and West Bengal.&nbsp;THE ALLCHEMY&nbsp;Handcrafted Dokra Brass Metal items are ideal for home decor, desk decor or a perfect gift item for birthday, marriage, engagement and any other occasions. This product is hand crafted and may have slight irregularities that are a natural outcome of the human involvement in the process.</p>\r\n	</li>\r\n</ul>', 0, NULL, '2023-02-10 10:16:54', '2023-03-02 09:02:05', 1, 1, 'The Allchemy Dhokra Turtle', 'THE ALLCHEMY dhokra item has beautiful curve features in its design. It is a must have if you want to add that Royal touch to your home.\r\nDimension: Height - 12\" ; Width - 4.5\" ; Length - 8\"', '2023-02-17-63ef29f36c152.png', 1, NULL, 0.00, 0, NULL, NULL, '107242'),
