(109, 'admin', 2, 'Metal Boat Decorative Item', 'metal-boat-decorative-item-aPtXJh', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"34\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-10-63e6210d9c390.png\",\"2023-02-10-63e6210d9f491.png\",\"2023-02-10-63e6210d9f7fd.png\",\"2023-02-10-63e6210d9fb3d.png\",\"2023-02-10-63e6210d9ffaf.png\"]', '2023-02-10-63e6210da012b.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1199, 222, '', 'percent', '30', 'percent', 1, 1, '<p>Handcrafted in Bastar Art using wrought iron. Mostly, Each piece emerges from a single metal sheet with hammer strokes and chiseled to the desired design.</p>\r\n\r\n<p><strong>About this item:</strong></p>\r\n\r\n<ul>\r\n	<li>Item Dimensions: 34&nbsp;x 12&nbsp;x 9&nbsp;inch</li>\r\n	<li>Included Components: 1&nbsp;kerala boat statue</li>\r\n	<li>Specific Uses for Product:&nbsp;Ideal for Home use, Side Table, Office and Gifting to near and dear ones</li>\r\n	<li>Special Features: No modern machinery is involved in its crafting, not even a welding machine. Pieces are joined together by rivets.&nbsp;</li>\r\n	<li>Care Instructions: Gentle clean with a dry cotton cloth</li>\r\n</ul>', 0, NULL, '2023-02-10 10:48:45', '2023-02-23 10:50:32', 1, 1, 'The Allchemy Metal Boat Decorative Item', 'Handcrafted in Bastar Art using wrought iron. Mostly, Each piece emerges from a single metal sheet with hammer strokes and chiseled to the desired design.\r\n\r\nAbout this item:\r\n\r\nItem Dimensio', '2023-02-17-63ef2aaa1b29b.png', 1, NULL, 0.00, 0, NULL, NULL, '121951'),
(110, 'admin', 2, 'Metal Candle Stand', 'metal-candle-stand-IZL5uN', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"23\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-10-63e6242452a21.png\",\"2023-02-10-63e62424551de.png\",\"2023-02-10-63e62424554f4.png\",\"2023-02-10-63e6242455691.png\",\"2023-02-10-63e6242455a5b.png\"]', '2023-02-10-63e6242455c02.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1999, 747, '', 'percent', '25', 'percent', 3, 1, '<p>&nbsp;</p>\r\n\r\n<p>Decorate your home with An ancient method of making metal artifacts encompassing wrought iron designs, . This beautiful artwork will provide a Traditional yet Modern look to your ambiance. This is a Indian Tribal art form of around 5000 years old and still in use today due to its simplicity, folk designs and vintage looks. It could take up to one week to create single piece due to a lot of process involved in Dhokra Art. This Ancient Art has been passed down generation to generation to highlight perfect union between Traditional and Modern Art . Its a perfect platform to showcase the innovation and evolution of our civilization . Perfect gift for loved ones/Dimensions 14x12 cm Its a perfect decor for Office, Living room, Study room , Desk, Corner piece, Gift purpose Handmade by 100% approved Artisans It will provide a vintage look to your ambiance You can use soft dry cloth or soft bristled brush to clean the figurine !!</p>', 0, NULL, '2023-02-10 11:01:56', '2023-03-02 09:00:07', 1, 1, 'The Allchemy Metal Candle Stand', 'Decorate your home with An ancient method of making metal artifacts encompassing wrought iron designs, . This beautiful artwork will provide a Traditional yet Modern look to your ambiance.', '2023-02-17-63ef2baea9000.png', 1, NULL, 0.00, 0, NULL, NULL, '142984'),
