(121, 'admin', 2, 'Dhokra deer', 'dhokra-deer-oR5Jhk', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"34\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-02-14-63eb362559b24.png\",\"2023-02-14-63eb36255aef6.png\",\"2023-02-14-63eb36255f2e0.png\",\"2023-02-14-63eb36255f704.png\",\"2023-02-14-63eb36255fd77.png\"]', '2023-02-14-63eb3625607ff.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1599, 351, '', 'percent', '35', 'percent', 0, 1, '<p>Dhokra Metal is hand crafted which tells a saga of rich cultural heritage and legacy of primitive metal craft through our vibrant craftsmen. Dhokra Metal Craft handmade by the tribal artisans of India. This showpiece will add value to your home d&eacute;cor. Dhokra (also spelt Dokra) is non ferrous metal casting using the lost-wax casting technique. This sort of metal casting has been used in India for over 4,000 years and is still used. Place this in any corner of your house or office and it will immediately add on to the overall beauty of any space. You can also acquire other bell metal items to decorate a wall and give that antique showcased area that tells a saga of its own.</p>\r\n\r\n<p>THE ALLCHEMY&nbsp; brings you this decorative brass deer showpiece made of good quality brass. Excellent antique kind of product for your drawing room, original brass product. Perfect for Gifting purposes. Crafted by the tribal artists of Chhattisgarh [Dhokra craft from Chhattisgarh]. Please note: Due to various lighting and flash colors used while photo shoot, the color shade of the product may vary. The products are made in dhokra art by hand by the tribal artists of Chhattisgarh. Dhokra craft is a casting technique using age-old wax-casting. Hence, the product might have some black/dull patches, which is a symbol of handcrafted dhokra art.</p>', 0, NULL, '2023-02-14 07:20:05', '2023-03-02 09:04:56', 1, 1, 'The Allchemy Dhokra deer', 'Dhokra Metal is hand crafted which tells a saga of rich cultural heritage and legacy of primitive metal craft through our vibrant craftsmen. Dhokra Metal Craft handmade by the tribal artisans', '2023-02-15-63ecd295a0486.png', 1, NULL, 0.00, 0, NULL, NULL, '148857'),
(122, 'admin', 2, 'Dhokra Nandi Small', 'dhakra-nandi-small-4GHVy6', 'physical', '[{\"id\":\"1\",\"position\":1},{\"id\":\"34\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-07-07-64a7af6cc92b0.png\"]', '2023-07-07-64a7af6cc9d02.png', '1', NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 1999, 625, '', 'percent', '30', 'flat', 2, 1, '<p>Dhokra decorative Nandi&nbsp; small&nbsp;<br />\r\nMaterial: Brass, Art Type: Dhokra Art which is 100% handmade using the lost-wax casting technique.<br />\r\nThe allchemy brings you this decorative tribal Nandi figurine made of good-quality brass. Brass-sitting Nandi has very fine finishing handcrafted by the skilled artisans of the Bastar region. Tribal Nandi enhances the decor value of your house, office or temple and will add a spot of lustre to the ambience. Indeed these collectables add elegance to home decor. Crafted by the tribal artisans of Chhattisgarh (Dhokra art of Chhattisgarh). Dhokra craft is a casting technique using age-old wax casting. Hence, the product might have some black/dull patches which is a symbol of handcrafted Dhokra art.&nbsp;<br />\r\nPerfect to decorate your home. Can also be used as a showpiece for office tables and as a gift option for housewarming &amp; other occasions<br />\r\nCarefully Handcrafted by the Tribal Artisans of India.</p>\r\n\r\n<p>&nbsp;</p>', 0, NULL, '2023-02-14 07:39:10', '2023-07-07 06:45:46', 1, 1, 'The Allchemy Handmade Dhokra Nandi Small | Handcrafted Decorative Dhokra Nandi', 'Handmade Dhokra Decorative NandiSmall- The allchemy brings you this Handcrafted Decorative Dhokra Nandi figurine made of good-quality brass.', '2023-02-15-63ecd2ea28134.png', 1, NULL, 0.00, 0, NULL, NULL, '180904'),
