(221, 'admin', 2, 'Unique Handmade Small Side Bag', 'unique-small-side-bag-b-3VM5WC', 'physical', '[{\"id\":\"5\",\"position\":1},{\"id\":\"15\",\"position\":2}]', 2, 'pc', 1, 1, NULL, NULL, '[\"2023-03-01-63ff39c621fa8.png\",\"2023-03-01-63ff39c624221.png\",\"2023-03-01-63ff39c624442.png\",\"2023-03-01-63ff39c6245ff.png\",\"2023-03-01-63ff39c6247f6.png\",\"2023-03-01-63ff39c62491e.png\"]', '2023-03-01-63ff39c624b8c.png', NULL, NULL, 'youtube', NULL, '[]', 0, 'null', '[]', '[]', 0, 499, 100, '', 'percent', '10', 'percent', 1, 1, '<ul>\r\n	<li>SIMPLE &amp; ELEGANT DESIGN: Stylish and elegant tote shoulder bag/purse with a simple tassel for decoration. Great for casual or many other occasions such as travel, business, work, gym, beach, etc.</li>\r\n	<li>QUALITY MATERIAL: Made of high quality sturdy faux leather material that&rsquo;s light weight and comfortable to carry.</li>\r\n	<li>Occasion: Work, Weekend, Travel, Party, Evening, Daily, Any occasion</li>\r\n	<li>Perfect Gifts: beloved, friends, parents, daughter, girlfriend, Christmas,saint valetine, birthday, mother&#39;s day, new year, Thanksgiving etc</li>\r\n</ul>\r\n\r\n<p>Double zipped pocket bag with satchel hand-made by the Hill tribe people of Northern Thailand. They are the native people who have lived in the northern region for centurieThe handmade bag is famous for its unique and intricate hand-woven designs. The bag is made of cotton and decorated with colourful patterns.<br />\r\nThe handmade bags are a dying art, and are becoming more and more rare.<br />\r\nThankfully they have become a popular fashion accessory and tourists often visit the Hill tribes to aquire these unique bags.</p>', 0, NULL, '2023-03-01 11:40:54', '2023-07-06 06:50:57', 0, 1, 'The Allchemy Unique Small Side Bag | Handmade Small Side Bag', 'Handmade Small Side Bag: SIMPLE & ELEGANT DESIGN: Stylish & elegant tote shoulder bag/purse with a simple tassel for decoration. Great for casual or many other occasions such as travel, busin', '2023-03-01-63ff39c62505d.png', 1, NULL, 0.00, 0, NULL, NULL, '161226'),
